import React from 'react';
import './FriendList.css';


// ICONS
import VideoCallIcon from '@mui/icons-material/VideoCall';
import SearchIcon from '@mui/icons-material/Search';
import MoreHorizIcon from '@mui/icons-material/MoreHoriz';
import { Avatar } from '@mui/material';




const FriendList = ({Header , avater}) => {
  return (
    <div className='friendList'>
      <div className="friend__header">
        <div className="friend__header__left">
          <h4>{Header}</h4>
        </div>
        <div className="friend__header__right">
        <VideoCallIcon />
        <SearchIcon />
        <MoreHorizIcon />
        </div>
      
      </div>
      <div className='list__friends'>
        <div className="friend online">
            <Avatar src={avater}/>
            <p>Dipanjan Mukherjee</p>
        </div>
        <div className="friend ">
            <Avatar />
            <p>Dipanjan Mukherjee</p>
        </div>
      </div>
    </div>
  )
}

export default FriendList
